import { Avatar, Container } from '@mui/material';
import Image from 'next/image';
import { useContext, useEffect, useState } from 'react';
import { IChildrenProps } from '../../../../common/interfaces/children-props.interface';
import { UserContext } from '../../../../contexts/user.context';
import { jobService } from '../../../../services/services/jobs.service';
import { userService } from '../../../../services/services/users.service';
import AutoSuggestion from '../../../suggestion/autoSuggestions/AutoSuggestion';
import styles from './HomeLayout.module.scss';

export interface IHomeLayout extends IChildrenProps { }

const HomeLayout: React.FC<IHomeLayout> = ({ children }) => {
  const { user } = useContext(UserContext);
  const [recUsers, setRecUsers] = useState([]);
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    const func = async () => {
      const recusers = await userService.getAllUsers();
      return setRecUsers(recusers.docs);
    };
    func();
  }, []);


  useEffect(() => {
    const func = async () => {
      const jobs = await jobService.getJobs({});
      return setJobs(jobs.docs);
    };
    func();
  }, []);

  return (
    <Container className={styles.container}>
      {user && (
        <>
          <div className={styles.left}>
            <div className={styles.userInfoCard}>
              <div className={styles.top}>
                <div className={styles.avatar}>
                  {user && (
                    <Avatar className={styles.avatar} alt={'User'}>
                      <Image
                        src={user.profileImage.url}
                        alt={user.profileImage.name}
                        fill
                      />
                    </Avatar>
                  )}
                </div>
              </div>
              <div className={styles.content}>
                <div className={styles.welcome}>
                  Welcome {`${user.firstName} ${user.familyName}`}!
                </div>
                <div className={styles.connections}>
                  <div className="">Connections: </div>
                  <div className="">{user.connections.length}</div>
                </div>
                <div className={styles.connections}>
                  <div className="">Date of Birth: </div>
                  <div className="">{user.dateOfBirth}</div>
                </div>
              </div>
            </div>
            {/* <div className={styles.homeGroup}>Groups</div> */}
            {/* <CreateJob /> */}
            <div className={styles.homePhoto}>
              <h1>Photos</h1>
              <div className={styles.homePhotoImages}>
                <div className={styles.homePhotoImage}>
                  <Image
                    src="data:image/jpeg;base64,"
                    alt=""
                    fill
                  />
                </div>
                <div className={styles.homePhotoImage}>
                  <Image
                    src="data:image/jpeg;base64,"
                    alt=""
                    fill
                  />
                </div>
                <div className={styles.homePhotoImage}>
                  <Image
                    src="data:image/jpeg;base64,"
                    alt=""
                    fill
                  />
                </div>
                <div className={styles.homePhotoImage}>
                  <Image
                    src="data:image/jpeg;base64,"
                    alt=""
                    fill
                  />
                </div>
              </div>
            </div>
          </div>
          <div className={styles.mid}>{children}</div>
          <div className={styles.right}>
            <div className={styles.peopleSuggestions}>
              <h1>People you might know</h1>
              <div className={styles.autoSugg}>
                {recUsers.map((rec, idx) => (
                  <AutoSuggestion key={idx} recuser={rec} />
                ))}
              </div>
            </div>
            <div className={styles.jobs}>
              <h1>Job List</h1>
              <div className={styles.jobList}>
                {/* start of job list */}
                {jobs && (
                  <>
                    {jobs.slice(0, 5).map((job, idx) => (
                      <div className={styles.job} key={idx}>
                        <div className={styles.details}>
                          <div className={styles.image}>
                            {' '}
                            <Image
                              src="https://cdn.pixabay.com/photo/2018/03/19/19/54/job-3241018_640.jpg"
                              alt=""
                              fill
                              style={{ objectFit: 'contain' }}
                            />
                          </div>
                          <div className={styles.detail}>
                            <span className={styles.name}>{job.title}</span>
                            <span className={styles.cName}>{job.company}</span>
                            <span className={styles.address}>
                              {job.location}
                            </span>
                            <div className={styles.timeAndApp}>
                              <span className={styles.time}> 1 min ago </span>
                              <span>50 applicants</span>
                            </div>
                          </div>
                        </div>
                      </div>
                    ))}
                  </>
                )}
                {/* end of job list */}
              </div>
            </div>
          </div>
        </>
      )}
    </Container>
  );
};

export default HomeLayout;
